import React from "react";
import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";


// Pages
import BlogListPage from "./components/page/BlogListPage";
import ContentPage from "./components/page/ContentPage";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<BlogListPage />} />
        <Route path="/post/:postId" element={<ContentPage />} />
        <Route path="/tags/:tagName" element={<TagFilteredPage />} /> // 태그 이름에 따라 필터링된 페이지를 위한 라우트를 추가합니다.
      </Routes>
    </Router>
  );
}

export default App;
